import React from "react";
import {
  Tabs as MuiTabs,
  Tab,
  Box,
  InputBase,
  Button,
} from "@material-ui/core";
import { withStyles } from '@material-ui/core/styles';
import Grid from './Grid';
import AddData from "./AddData";
import AnalyticalView from "./AnalyticViewTab";

const ColorButton = withStyles((theme) => ({
  root: {
    color: "#ffffff",
    backgroundColor: "#8fd163",
    '&:hover': {
      backgroundColor: "#8fd163",
    },
  },
}))(Button);

const TabContent = () => {
  const [selectedTab, setSelectedTab] = React.useState(0);
  const [searchText, setSearchText] = React.useState("");
  const [searchResults, setSearchResults] = React.useState([]);
  const [showSearchResults, setShowSearchResults] = React.useState(false);

  const handleTabChange = (event, newValue) => {
    setSelectedTab(newValue);
    clearSearchResults();
  };

  const handleSearchTextChange = (event) => {
    setSearchText(event.target.value);
  };

  const handleSearch = (event) => {
    if (event.key === "Enter") {
      axios.get("http://localhost:8080/h2h_project/DataLoadingServlet")
      .then(res => {const data = res.data;})
      const searchResult = data.filter(
        (item) => item.orderId === parseInt(searchText)
      );
      setSearchResults(searchResult);
      setShowSearchResults(true);
    }
  };

  const clearSearchResults = () => {
    setSearchText("");
    setSearchResults([]);
    setShowSearchResults(false);
  };

  return (
    <Box>
      <Box display="flex" justifyContent="flex-end" alignItems="flex-end">
        <InputBase
          placeholder="Search Customer Order ID"
          style={{ backgroundColor: "white", margin: "10px 5px 5px 10px" }}
          value={searchText}
          onChange={handleSearchTextChange}
          onKeyPress={handleSearch}
        />
        {showSearchResults ? (
          <Button variant="contained" onClick={clearSearchResults}>
            Clear
          </Button>
        ) : (
          <ColorButton variant="contained">
            Advanced Search
          </ColorButton>
        )}
      </Box>
      <MuiTabs value={selectedTab} onChange={handleTabChange}>
        <Tab label="Homepage" />
        <Tab label="Add Data" />
        <Tab label="Analytical View" />
      </MuiTabs>
      <Box p={3}>
        {selectedTab === 0 && <HomepageTab />}
        {selectedTab === 1 && <AddDataTab />}
        {selectedTab === 2 && <AnalyticalViewTab />}
        {showSearchResults && (
          <Box mt={3}>
            <SearchResults results={searchResults} />
          </Box>
        )}
      </Box>
    </Box>
  );
};

const HomepageTab = () => {
  // Implement the content for the Homepage tab (table and buttons) here
  return <div><Grid /></div>;
};

const AddDataTab = () => {
  // Implement the content for the Add Data tab here
  return <div><AddData /></div>;
};

const AnalyticalViewTab = () => {
  // Implement the content for the Analytical View tab here
  return <div><AnalyticalView/></div>;
};

const SearchResults = ({ results }) => {
  // Implement the search results component here
  return (
    <div>
      {/* Display the search results */}
      {results.map((result, index) => (
        <div key={index}>{result}</div>
      ))}
    </div>
  );
};

export default TabContent;
